import { Food } from "../models/Food";
import { TestListElementBox } from "../styles/OrderTrans";
import { SerifText, SerifTextS } from "../styles/TextStyles";

export const SummaryList = ({ data }: any) => {
  return (
    <div style={{ marginTop: "5%" }}>
      {data.map((item: any) => (
        <TestListElementBox>
          <div style={{ flex: 2 }}>
            <SerifText>{item.name}</SerifText>
          </div>
          <div style={{ flex: 1 }}>
            <SerifText>x{item.amount}</SerifText>
          </div>
          <div style={{ flex: 1 }}>
            <SerifText>{item.price}$</SerifText>
          </div>
        </TestListElementBox>
      ))}
    </div>
  );
};
